// src/pages/SwipeProject.js
import React, { useState } from 'react';
import './SwipeProject.css';

const projects = [
  {
    title: 'Web Development Project',
    description: 'We are looking for an experienced web developer to build a responsive e-commerce site with integrated payment solutions and a custom CMS.',
    budget: '$1500 - $2000',
    duration: '3 months',
    freelancer: {
      name: 'John Smith',
      rating: '4.8/5',
    },
  },
  {
    title: 'Graphic Design Project',
    description: 'Need a creative designer to work on branding and graphic assets for our new app.',
    budget: '$800 - $1200',
    duration: '1 month',
    freelancer: {
      name: 'Jane Doe',
      rating: '4.7/5',
    },
  },
  // Add more projects as needed
];

function SwipeProject() {
  const [currentIndex, setCurrentIndex] = useState(0);

  const swipe = (direction) => {
    if (direction === 'left' || direction === 'right') {
      setCurrentIndex((prevIndex) => prevIndex + 1);
    }
  };

  const currentProject = projects[currentIndex];

  return (
    <div className="swipe-container">
      {currentProject ? (
        <div className="card">
          <div className="card-content">
            <h2>{currentProject.title}</h2>
            <p>{currentProject.description}</p>
            <div className="details">
              <p><strong>Budget:</strong> {currentProject.budget}</p>
              <p><strong>Duration:</strong> {currentProject.duration}</p>
              <p><strong>Freelancer:</strong> {currentProject.freelancer.name}</p>
              <p><strong>Rating:</strong> {currentProject.freelancer.rating}</p>
            </div>
          </div>
          <div className="buttons">
            <button onClick={() => swipe('left')} className="swipe-btn left">❌</button>
            <button onClick={() => swipe('right')} className="swipe-btn right">✅</button>
          </div>
        </div>
      ) : (
        <h2 className="no-more-projects">No more projects</h2>
      )}
    </div>
  );
}

export default SwipeProject;
